import React from 'react';
import './Nosotros.css';
import rueda from './rueda.png';

const Nosotros = () => {
return (

  <div className=" bg-white  vh-75">
    <div className="w-70 flex flex-column justify-content center ">

      <div className="tc ">
         <h1 className="w-70 center f1 fw4">Hola, Somos una agencia de innovacion digital  enfocada en incrementar valor</h1>

      </div>
      <div className="tc ">
        <p className="f4  ">
          Creemos que utilizando tecnologias innovadoras podemos disipar las dudas de elegir que servicio usar
          y ademas que agregen valor a los productos y servicios que brinda actualmente de modo que podamos llegar al objetivo trazado.
        </p>

      </div>

      <div className=" tc  ">
          <p className="f4-l f3 fw1 white tracked-tight">
            <span className="f3-l pointer f5 tracked-tight dib bg-animate hover-bg-red hover-white no-underline pv3 ph6-l ph5 br2 ba boton-bg border-col white ">CONOCENOS MAS</span>
          </p>
      </div>


      <div className="tc">
        <img className="pa3" src={rueda} alt=""/>
      </div>



    </div>
  </div>


);
}

export default Nosotros;
